INSERT INTO `tp_cours` (`id`, `code`, `nom`, `img`, `trigramme`, `description`, `intitule`, `prenom`) VALUES
(1, 'D41', 'Berger', NULL, 'MBE', 'A l’heure du développement de la technologie et de la communication dans notre société, le réseau\r\ninformatique mondial, comme vecteur de l’information, est devenu un élément central dans le\r\nfonctionnement et le développement de notre société moderne.\r\nEn effet, de nouvelle application sont de plus en plus présentes dans notre vie de tous les jours.\r\nPour répondre aux besoins grandissants, les réseaux informatiques sont en perpétuel évolution.\r\nA travers ce cours, nous aborderons, à travers les outils que l’on utilise tous les jours, l’ensemble\r\ndes bases qui régissent le fonction des réseaux informatique', 'Consolidation des compétences réseaux', 'Martial'),
(2, 'D12', 'Haddad', NULL, 'JHA', '“La richesse d’Internet réside\r\ndans son universalité. Il est\r\nessentiel que chacun, handicapé\r\nou non, puisse y avoir accès”\r\nTim BERNERS-LEE', 'UX-UI Design', 'Jihane'),
(3, 'AD9', 'Simon', NULL, 'FSI', 'Installation + configuration :\r\n- Installer Apache grâce à la commande apt-get\r\n- Créer un nouveau fichier de configuration dans le dossier\r\n/etc/apache2/sites-available au format www.mon-site.com.conf\r\n- Rédiger le vhost à l’intérieur\r\n- Créer votre dossier projet dans le dossier /var/www/html au format\r\nwww.mon-site.com\r\n- Placer votre projet à l\'intérieur du dossier\r\n- Mettez à jour votre configuration si nécessaire\r\n- Activer la configuration de votre virtualhost\r\n- Recharger la configuration d’apache\r\n- Modifier votre fichier hosts pour que vous accédiez à votre site en tapant\r\nwww.mon-site.com dans la barre d’adresse', 'Linux', 'Fabien'),
(4, 'D42', 'Ribeiro', NULL, 'JRI', 'Les types de langages\r\n\r\nUn programme ?\r\n\r\nLes types de langage de programmation\r\n\r\nProcédural\r\n\r\nObjet\r\n\r\nEvènementiel\r\n\r\nLe fonctionnement\r\n\r\nLe compilateur : assembleur, bytecode, machine\r\n\r\nL’interpréteur', 'Consolidation des compétences en programmation', 'Julio');

